import React, { Component } from 'react';

class Experience extends Component {
    render() {
        return (
            <div className="whiteBox"> 

                    <div className="paragraphBox">

                    <div id="leftAlign">
                        <p className="mainFont3" >Experience</p>
                    </div>
                    <br></br>
                    <p><b>RAISED PROPER</b></p>   
                    <p>   
                    Founder and head of business operations for Los Angeles based creative studio specializing in branding and web development. Responsible for creation of high impact images through photography, video and graphic design.
                    </p> 
                    <br></br>
                    <p><b>KISSING KATE</b></p>
                    <p >Lead UX/UI designer at Kissing Kate LLC. Received 95% client satisfaction scores, 72% increase in traffic over 2 years and a 39% increase in sales. Deployed new features and spearheaded all design elements, layouts, and brand consistency.
                    </p>


                    </div>
            </div> 
        );
    }
}

export default Experience;
